import React, { useEffect, useState } from "react";
import { getAllHippos } from "../controllers/getAllHippos";

const HippoCentral = () => {
  const [hippos, setHippos] = useState([]);
  useEffect(() => {
    getAllHippos()
      .then((res) => {
        setHippos(res);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  console.log(hippos);

  return (
    <div>
      {hippos.map((hippo) => {
        return <div>{hippo.id}</div>;
      })}
    </div>
  );
};

export default HippoCentral;
